import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import api, { authAPI } from '../services/api';

const Login = () => {
  const navigate = useNavigate();
  const { login } = useAuth();

  const [mode, setMode] = useState('user'); // 'user' | 'delivery'
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [staffType, setStaffType] = useState('train');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleUserLogin = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    const result = await login(email, password);

    setLoading(false);

    if (!result.success) {
      setError(result.message || 'Login failed');
      return;
    }

    const loggedUser = result.user;

    if (loggedUser.role === 'admin') {
      navigate('/admin/dashboard');
    } else {
      navigate('/menu-categories');
    }
  };

  const handleDeliveryLogin = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const res = await api.post('/auth/delivery/login', { email, password });
      if (!res.data.success) {
        setError(res.data.message || 'Delivery staff login failed');
        setLoading(false);
        return;
      }

      const { token, staff } = res.data;
      localStorage.setItem('railbiteStaffToken', token);
      localStorage.setItem('railbiteStaff', JSON.stringify(staff));

      setLoading(false);

      if (staff.type === 'train') {
        navigate('/delivery/train/dashboard');
      } else {
        navigate('/delivery/station/dashboard');
      }
    } catch (err) {
      const message = err.response?.data?.message || 'Delivery staff login failed';
      setError(message);
      setLoading(false);
    }
  };

  const onSubmit = mode === 'user' ? handleUserLogin : handleDeliveryLogin;

  return (
    <div className="auth-page">
      <div className="auth-container">
        <div className="auth-header">
          <h2>RailBite Login</h2>
          <p>Sign in to continue ordering or managing deliveries.</p>
        </div>

        <div className="auth-toggle">
          <button
            type="button"
            className={`auth-toggle-btn ${mode === 'user' ? 'active' : ''}`}
            onClick={() => setMode('user')}
          >
            User Login
          </button>
          <button
            type="button"
            className={`auth-toggle-btn ${mode === 'delivery' ? 'active' : ''}`}
            onClick={() => setMode('delivery')}
          >
            Delivery Staff Login
          </button>
        </div>

        {mode === 'delivery' && (
          <div className="auth-subtoggle">
            <span className="auth-subtoggle-label">Delivery type:</span>
            <div className="auth-subtoggle-options">
              <button
                type="button"
                className={staffType === 'train' ? 'active' : ''}
                onClick={() => setStaffType('train')}
              >
                Train
              </button>
              <button
                type="button"
                className={staffType === 'station' ? 'active' : ''}
                onClick={() => setStaffType('station')}
              >
                Station
              </button>
            </div>
          </div>
        )}

        <form onSubmit={onSubmit} className="auth-form">
          <div className="form-group">
            <label className="form-label">Email</label>
            <input
              className="form-input"
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              autoComplete="email"
            />
          </div>

          <div className="form-group">
            <label className="form-label">Password</label>
            <input
              className="form-input"
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              autoComplete="current-password"
            />
          </div>

          {error && <div className="form-error">{error}</div>}

          <button type="submit" className="primary-btn full-width" disabled={loading}>
            {loading
              ? 'Logging in...'
              : mode === 'user'
              ? 'Login as User'
              : 'Login as Delivery Staff'}
          </button>
        </form>

        {mode === 'user' && (
          <div className="auth-footer">
            <button
              type="button"
              className="link-btn"
              onClick={() => navigate('/register')}
            >
              New user? Register here
            </button>
            <button
              type="button"
              className="link-btn"
              onClick={() => navigate('/forgot-password')}
            >
              Forgot password?
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default Login;
